import Forms from './Forms';
 function App() {
     const [signIn, toggle] = React.useState(true);
     const [signUp, toggle2] = React.useState(false); 

      return(
        <Router>
            <Routes>
                <Route path="/success" element={<SuccessPage />} />
                <Route path="/" element={<Forms />} /> {/* Use the Forms component here */}
            </Routes>
        </Router>
      )
 }

 export default App;
